import React from 'react';

export default class FlightStatus extends React.Component {
	statusStyle = {
		fontFamily: "Helvetica"
	};

	updateStyle = {
		textAlign: "right",
		float: "right",
		paddingRight: "20px",
		marginTop: "20px",
		fontSize: "14px"
	}

	statusElement = (
		<div>
			<h2 style={this.statusStyle}>{this.props.status}</h2>
			<h2 style={this.updateStyle}>Launch</h2>
			<h2 style={this.updateStyle}>Climb</h2>
			<h2 style={this.updateStyle}>Coast</h2>
			<h2 style={this.updateStyle}>Apogee</h2>
			<h2 style={this.updateStyle}>Descent</h2>
			<h2 style={this.updateStyle}>Landed</h2>
		</div>
	);

	render () {
		return (this.statusElement);
	}
}
